import React, { useState, useEffect } from 'react';
import { adminAPI } from '../../services/api';

const AnalyticsDashboard = () => {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAnalytics();
  }, []);

  const fetchAnalytics = async () => {
    try {
      const response = await adminAPI.getDashboard();
      setAnalytics(response.data);
    } catch (error) {
      console.error('Error fetching analytics:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading">Loading analytics...</div>;
  }

  if (!analytics) {
    return <div>No data available</div>;
  }

  return (
    <div className="analytics-dashboard">
      <div className="section-header">
        <h2>Platform Analytics</h2>
        <p>Comprehensive overview of platform performance and user engagement</p>
      </div>

      <div className="analytics-grid">
        <div className="analytics-card">
          <div className="card-header">
            <h3>User Statistics</h3>
          </div>
          <div className="card-content">
            <div className="stat-item">
              <span className="stat-label">Total Users</span>
              <span className="stat-value">{analytics.stats.totalUsers}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Active Institutes</span>
              <span className="stat-value">{analytics.stats.totalInstitutes}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Pending Approvals</span>
              <span className="stat-value">{analytics.stats.pendingInstitutes}</span>
            </div>
          </div>
        </div>

        <div className="analytics-card">
          <div className="card-header">
            <h3>Engagement Metrics</h3>
          </div>
          <div className="card-content">
            <div className="stat-item">
              <span className="stat-label">Total Reviews</span>
              <span className="stat-value">{analytics.stats.totalReviews}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Total Enquiries</span>
              <span className="stat-value">{analytics.stats.totalEnquiries}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">Response Rate</span>
              <span className="stat-value">85%</span>
            </div>
          </div>
        </div>

        <div className="analytics-card wide">
          <div className="card-header">
            <h3>Recent Platform Activity</h3>
          </div>
          <div className="card-content">
            <div className="activity-list">
              <h4>Pending Institute Approvals</h4>
              {analytics.recentActivities.pendingInstitutes.map(institute => (
                <div key={institute._id} className="activity-item">
                  <div className="activity-info">
                    <strong>{institute.name}</strong>
                    <span>by {institute.user.name}</span>
                  </div>
                  <span className="activity-time">
                    {new Date(institute.createdAt).toLocaleDateString()}
                  </span>
                </div>
              ))}
              
              <h4>Recent Reviews</h4>
              {analytics.recentActivities.recentReviews.map(review => (
                <div key={review._id} className="activity-item">
                  <div className="activity-info">
                    <strong>{review.user.name}</strong>
                    <span>reviewed {review.institute.name}</span>
                  </div>
                  <span className="activity-time">
                    {new Date(review.createdAt).toLocaleDateString()}
                  </span>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      <div className="charts-section">
        <h3>Platform Growth</h3>
        <div className="charts-placeholder">
          <p>ðŸ“ˆ Charts and graphs would be implemented here with a charting library like Chart.js</p>
          <p>This would show user growth, institute registrations, and engagement metrics over time.</p>
        </div>
      </div>
    </div>
  );
};

export default AnalyticsDashboard;
